СПЕЦІАЛІЗАЦІЯ: Цивільні, земельні, сімейні, трудові, господарські спори.

ПРАВОВА ДОПОМОГА з питань:
- визнання права власності на нерухоме майно та земельні ділянки;
- поділ майна, виділення частки;
- визначення порядку користування житловим будинком, квартирою та земельними ділянками,
- оренди нерухомого майна та земельної ділянки;
- скасування виконавчих написів нотаріусів, повернення безпідставно
стягнутих коштів;
- спадкування;
- визнання заповітів, договорів недійсними;
- стягнення заборгованості, неустойки, інфляційних втрат;
- розірвання шлюбу, стягнення аліментів та пені за їх несвоєчасну сплату;
- оспорювання батьківства, позбавлення батьківських прав, визначення місця проживання дитини;
- поновлення на роботі, відшкодування за час вимушеного прогулу, стягнення заборгованості по заробітній платі;
- заборгованості по кредитам, у відносинах з банками, колекторами;
- придбання майнових прав на житло у забудовників;
- оскарження постанов у справах про адміністративне правопорушення,
- укладення різного виду договорів;
