- Карты скидок, лояльности, индивидуальная настройка под каждого клиента( управление этими картами осуществляется через сервер);
- Счастливые часы - перевод всего автомоечного комплекса на заданную скидку, в выбранное время;
- Дежурное освещение поста по зачислению денежных средств, а также автоматическое выключение;
- Облачный сервер за слежением автомоечного комплекса, через приложение в интернете, смартфон;
- PayPass, PayPal поддержка банковской карты;
- ЖК-дисплей на пульте управления;
- Сервисный режим для администратора через карту.

ТЕХНИЧЕСКАЯ ЧАСТЬ
