Осушители воздуха используются для ускорения сушки мокрых процессов: штукатурки, шпаклевки, окраски стен и потолков, заливки стяжки и выравнивании полов. Кроме того качественная просушка поверхностей повышает качество ремонта, уменьшает возможность растрескивания и ее деформации, а также препятствует появлению плесени и грибка.

Осушитель необходим при:
- Ликвидации последствий затопления соседями;
- Сильной влажности стен и стяжки;
- Подтоплении цокольных этажей домов;
- Для более быстрого высыхания при проведении строительных работ связаных с влажными смесями и растворами;
- Борьбе с плесенью и грибками; 

Осушители может вытащить из воздуха и стен от 50 до 90 литров воды в сутки, что позволяет вести штукатурные или отделочные работы круглый год, включая зимнее время. Благодаря тому что влагоотделитель равномерно высушивает перекачеваемый воздух, технология отделочных и производственных работ не будет нарушена. 

