    - підготовку тексту повідомлення акціонерів про скликання Зборів;
    - замовлення та отримання переліку акціонерів, які мають бути повідомленні про скликання Зборів та переліку акціонерів, які мають право на участь у Зборах;
    - публікація повідомлення та розкриття інформації щодо скликання Зборів;
    - надсилання повідомлень акціонерам;
    - обробку вимог акціонерів щодо доповнення порядку денного/проектів рішень Зборів;
    - підготовку бюлетенів для голосування на Зборах;
    - підготовку проектів протоколів реєстраційної комісії (в т.ч. щодо обрання голови реєстраційної комісії, переліку акціонерів, які зареєструвались для участі у Зборах, проектів відмови у реєстрації на Збори;
    - підготовку проектів протоколів про підсумки голосування на Зборах;
    - підготовку проекту протоколу Загальних зборів акціонерів;
    - проведення реєстрації акціонерів, ведення Зборів та підрахунок голосів на Зборах;
