Сонячна електростанція (СЕС) — це система на основі сонячних панелей, які працюють в поєднанні зі спеціальним перетворювачем, або інвертором. Панелі поглинають сонячне світло і переводять постійний струм від них на інвертор А він, в свою чергу, постійну напругу в змінну. Таким  чином, підприємство забезпечується безкоштовною енергією, яка залежить від того, наскільки інтенсивний рівень сонячного освітлення.

Чим більше встановлено сонячних панелей та чим вища потужність інвертора, тим більший відстоток споживання можна замістити в енергобалансі підприємства.

Причини встановити СЕС на власному підприємстві:
- Незалежність від цін на електроенергію, закріпіть
вартість 0,8 грн/кВт до 2050 року;
- Турбота про екологію, сонячні батареї найекологічніший спосіб виробництва енергії;
- Інвестиція з гарантією 22% річних;
- Не потрібно додаткових дозволів;
- Зі зростанням тарифів окупність стає
швидшою, а рентабельність вашого продукту зростатиме.

Обладнання нове, із гарантією, сертифікатами (деклараціями) та техпаспортами. 
